import React from "react";
import "./BoxContainer.css";

const BoxContainer = () => {
  return (
    <div className="row">
      {/* Left Column: Image */}
      <div className="column left">
        <img
          src="https://via.placeholder.com/800x600"
          alt="Example"
          className="image"
        />
      </div>

      {/* Right Column: Content + Button */}
      <div className="column right">
        <h2>Full Width Row & Columns</h2>
        <p>
          This is a simple full-width row with two columns. The left column
          contains an image, and the right column contains text and a button.
        </p>
        <button>Learn More</button>
      </div>
    </div>
  );
};

export default BoxContainer;
